app.get('/qr',async(req,res)=>{
    let content = req.query.content;
    let amount  = req.query.amount;
    let qrtext = `00020101021238540010A00000072701240006970436011010900000040208QRIBFTTA530370454${amount.length<10?'0'+amount.length:amount.length}${amount}5802VN62${content.length+4<10?'0'+content.length+4:content.length+4}08${content.length<10?'0'+content.length:content.length}${content}6304`
    console.log("qrtext",qrtext)
    let crcCode = crc.crc16ccitt(qrtext).toString(16)
    let qr= await QRCode.toDataURL(qrtext+crcCode);
    const qrCode = await create(
        qrtext+crcCode,
        "data:image/png;base64,",
        202,
        50
    );
    img = `<image src= " `+qrCode+ `" />`
    return res.send(img);
});
